- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XA\x1CFebruary 23, 2011  Mr. Daniel Buckley
    Federal Election Commission Washington, DC 20463  Re:  Amended 2010 October Monthly
    Report  Dear Mr. Buckley:  The following responds to your letter of January 19,
    2011 regarding the Amended 2010 October Monthly Report, filed by the Republican
    Party of Texas -RPT.  Detail schedules of Line 21b, Line 22, Line 23, Line 29,
    and Line 30b have been disclosed itemizing all expenditures during the reporting
    period to include payees that aggregate greater than $200 in the calendar year.
    \ All transfers on Lines 22 and 23 have been itemized regardless of the amount
    transferred.   Payments disclosed on Schedule D for Strategic Telecommunications,
    Steve Brown Direct Mail, Pinnacle Direct, Inc., and ElectionMall, and Aristotle
    are disclosed on Line 21b.  Additional debt payments are disclosed on 21b and
    H4.  Schedule A discloses a total of $2,747.32 in-kind contribution from Stephen
    Munisteri.  Please be advised that these in-kind contributions have also been
    included on Schedule B in three disbursements for $1,682,71, $977.25, and $87.36,
    which totals $2,747.32.  The in-kind contribution from Mr. Jesse A. Lewis for
    $290.40 is included on both Schedules A and B.  The in-kind contribution from
    the Republican National Committee for $57,481 and $298 are included on Schedule
    A and B.  The in-kind contribution from Pete Sessions for Congress for $95 is
    included on both Schedule A and B.  Schedule H2 discloses three Party fundraising
    events.  The Party did not use any federal candidate names in any special communications,
    fundraising event or advertising projects.  The disbursement to Butrum & Associates
    is associated with the Houston Fundraiser disclosed on H2.  Schedule H5 discloses
    a transfer from the Party Levin account to the Federal account.  Schedule L-B
    has been corrected to reflect transfer in the amount of $20,095.96 for GOTV activity
    and $10,304.04 for Voter Registration as reflected on H5.  The previously recorded
    100% federal disbursement on H4 has been corrected to reflect the appropriate
    allocated ratio.  Tom Mechler, Treasurer Republican Party of Texas\n"
